class Solution:
    def majorityElement(self, nums):
        """
        :type nums: List[int]
        :rtype: List[int]
        """
        count1, count2, candidate1, candidate2 = 0, 0, 0, 1
        for num in nums:
            if num == candidate1:
                count1 += 1
            elif num == candidate2:
                count2 += 1
            elif count1 == 0:
                candidate1 = num
                count1 = 1
            elif count2 == 0:
                candidate2 = num
                count2 = 1
            else:
                count1, count2 = count1-1, count2-1
        return [candidate1, candidate2] if (sum(nums.count(candidate1) > len(nums)//3)
                                            and sum(nums.count(candidate2) > len(nums)//3)) else []

