from collections import defaultdict
from functools import lru_cache
from itertools import product


def solve(N, M):
    # print(N, M)
    if N == 1:
        return 0 if M % 2 else 1
    if N == 2:
        return 0 if M % 4 == 3 else 2
    if N == 3:
        return 0 if M % 6 == 3 else 4
    if N == 4:
        return 0 if M % 12 == 5 or M % 12 == 7 else 8
    if N == 5:
        return 0 if M % 10 == 3 or M % 10 == 7 else 16
    if N == 6:
        return 0 if M % 18 == 5 or M % 18 == 7 or M % 18 == 11 or M % 18 == 13 or M % 18 == 17 else 32
    if N == 7:
        return 0 if M % 20 == 3 or M % 20 == 7 or M % 20 == 17 else 64
    if N == 8:
        return 0 if M % 24 == 5 or M % 24 == 7 or M % 24 == 11 or M % 24 == 13 or M % 24 == 17 or M % 24 == 19 or M % 24 == 23 else 128

    @lru_cache(maxsize=None)
    def dp(n, m):
        if n == 1:
            return 0 if m % 2 else 1
        if n == 2:
            return 0 if m % 4 == 3 else 2
        if n == 3:
            return 0 if m % 6 == 3 else 4
        if n == 4:
            return 0 if m % 12 == 5 or m % 12 == 7 else 8
        if n == 5:
            return 0 if m % 10 == 3 or m % 10 == 7 else 16
        if n == 6:
            return 0 if m % 18 == 5 or m % 18 == 7 or m % 18 == 11 or m % 18 == 13 or m % 18 == 17 else 32
        if n == 7:
            return 0 if m % 20 == 3 or m % 20 == 7 or m % 20 == 17 else 64
        if n == 8:
            return 0 if m % 24 == 5 or m % 24 == 7 or m % 24 == 11 or m % 24 == 13 or m % 24 == 17 or m % 24 == 19 or m % 24 == 23 else 128

        for a in range(n // 2 + 1):
            b = n - a
            if m < a or m < b:
                continue
            yield dp(a, m - a) * dp(b, b) * (2 if a == n // 2 else 1)
    return sum(dp(N, M) for a, b in product([0, 1], repeat=N)) % (10**9)


def main():
    N = int(input())
    M = int(input())
    print(solve(N, M))


