def get_same_minute_time(star1, star2, interval1, interval2):
    def get_time(s, interval):
        while s != datetime.strptime(star2, '%H:%M'):
            s += timedelta(hours=interval.split(':')[0], minutes=interval.split(':')[1])
        return s

    def get_weekday(s):
        return s.strftime('%A')

    s = datetime.strptime(star1, '%H:%M')
    s = get_time(s, interval1)
    s = get_time(s, interval2)
    return get_weekday(s), s.strftime('%H:%M')


