from math import hypot, atan2, pi
from collections import Counter
import re


def gesture(a, b):
    def spread(g):
        return sum(hypot(x - g[0], y - g[1]) for x, y in g) / len(g)

    def angle(v):
        return atan2(v[1], v[0])

    def rotate(g, avg):
        return sum(angle(v - avg) for x, y, v in g) / len(g)

    def dist(a, b):
        return hypot(b[0] - a[0], b[1] - a[1]) ** 2

    def match(g1, g2):
        return sum(dist(t1, t2) for t1, t2 in zip(g1, g2)) / len(g1)

    def score(g):
        s = match(a, b)
        if s < 0.0001:
            return 0
        p = match(a, g) + match(b, g)
        r = rotate(a, avg_a) + rotate(b, avg_b)
        z = spread(a) - spread(b)
        return (s + p + r * z) / 3

    avg_a = (sum(x + y for x, y in a) / (2 * len(a)),
             sum(x + y for x, y in a) / (2 * len(a))) if a else (0, 0)
    avg_b = (sum(x + y for x, y in b) / (2 * len(b)),
             sum(x + y for x, y in b) / (2 * len(b))) if b else (0, 0)
    return max((score(g), 'pan' if avg_a == avg_b else 'zoom' if z > 0 else 'rotate') +
               ('out' if z > 0 else 'in') for g in a if re.search(r'\X', ''.join(map(str, g))))


def main():
