from collections import defaultdict
from itertools import groupby


def solve(s):
    d = defaultdict(list)
    for i, c in enumerate(s):
        d[c].append(i)
    res = 0
    for k, v in list(d.items()):
        if k.islower():
            continue
        g = list(groupby(v))
        for i, (k2, v2) in enumerate(g):
            if i == 0:
                continue
            if (v2[0] - g[i-1][1][0]) % 4 != 0:
                res += (v2[0] - g[i-1][1][0]) % 4
    return res


